import React, {Component} from 'react';

class CardSet extends Component {
    constructor(props) {
        super(props);
        this.state = {
            error: null,
            isLoaded: false,
            items: []
        };
    }

    componentDidMount() {
        fetch("api/cardsets")
            .then(response => response.json())
            .then((result) => {
                this.setState({
                    isLoaded: true,
                    items: result
                });
            },
            (error) => {
                this.setState({
                    isLoaded: true,
                    error
                });
            }
        )
    }

    render () {
        return (
            <ul>
                {items.map(item => (
                    <li>
                        Item title: {item.title}
                    </li>
                ))}
            </ul>
        );
    }

}

export default CardSet;
